talk.text:
普通人要避免的长期主义陷阱

/// 陷阱一：长期主义≠盲目坚持

普通人最容易掉进的陷阱就是盲目坚持，用坚持感动自我，换不回一点价值产出。

我在去年下半年，做的最有价值的事是，用3个月跑通了2个小项目拿到闭环，成绩很小，意义很大。一段时间内高频的做项目，快速试错是短期拿到结果的有效路径，这些也都得益于老徐的副业避坑星球发起的多个超值的小项目，让我没有负担的快速试错！~

/// 陷阱二：长期主义≠定力

二者都强调目标导向、坚持、专注。区别点在于，定力侧重于短期和当下的内心的稳定、专注和抗干扰能力。

长期目标需要做“坚持会很难的事”，但我们普通人短期得先赚到到钱生存，短期要拿结果就不能晃晃悠悠的想着“慢慢来“。

/// 陷阱三：长期主义≠难而正确

长期主义的事并不都是很难的事。长期主义目标导向下，一定会遇到很多难而正确的事不能逃避，也有很多简单而正确的小事每天坚持就能获益。

作为普通人，可以先从坚持做简单而正确的小事开始，培养自律的好习惯，塑造长期主义的心态，增强信心和成就感。
